import React from 'react'
import './SEPage.css'

const SEPage = () => {
  return (
    <div className="se-page-container">
      <h1 className="se-page-title">Software Engineering Page</h1>
      <p className="se-page-message">Welcome engineer</p>
    </div>
  )
}

export default SEPage
